function Square() {
    let n = parseInt(prompt("Enter a number: "));
    alert("Square of " + n + " is " + n*n);
}

function Add() {
    let n1 = parseInt(prompt("Enter number 1: "));
    let n2 = parseInt(prompt("Enter number 2: "));
    alert("Sum of " + n1 + " and " + n2 + " is " + (n1 + n2));
}

function Foo() {
    Add();
    Square();
}

export default Foo;
